function removeDuplicates(arr) {
    var new_arr=[],index=0;   
    for(var i=0;i<arr.length;i++)
    {
        if((i+1)<arr.length)
        {
                if(arr[i].dataElement==arr[i+1].dataElement)
                {
                    index=i;
                    arr.splice(index,1);
                }
        }        
    }
    //console.log(arr);
    return arr;    
}
